import React, { Component } from 'react';
import './App.css';

import Contact from './Contact.js'

class Home extends Component {  

  render() {
    return (

      <div className="main">
      <div className="typewriter">
       TFSites
      </div>
      <div className="rowflex">
      <div className="enter">
       Sites
      </div>
      <div className="enter">
       About
      </div>
      <div className="enter">
       Contact 
      </div>
      </div>
      </div>
    );
  }
} 

export default Home;
